Define a map to associate attribute types with their respective handling functions. Find the handler for the given attribute type, If the handler is found, call it; otherwise, handle the error:

static const std::unordered_map<std::string, std::function<void(const Json&)>> attributeHandlers = {
        {"string", [](const Json& entry) { constructAttribute<BIOSStringAttribute>(entry); }},
        {"integer", [](const Json& entry) { constructAttribute<BIOSIntegerAttribute>(entry); }},
        {"enum", [](const Json& entry) { constructAttribute<BIOSEnumAttribute>(entry); }}
    };
